import React from 'react';
import Navbar from '../../components/Layouts/Navbar/Navbar';

function login() {
  return (
    <>
      <Navbar />
      <div className='login__container'>
        <div className='login__form'>login</div>
      </div>
    </>
  );
}

export default login;
